!function(t){t(document).ready((function(){let e=1,o=t(".home-posts__list");t(".home-posts__show-more-btn").click((function(s){s.preventDefault(),++e,t.ajax({dataType:"html",url:madHattersData.ajaxUrl,type:"post",data:{action:"show_posts",page:e},success:function(e){if(e){let s=t(e);t(o).append(s)}else t(".home-posts__show-more-container").hide()},error:function(t,e,o){console.log(t+" :: "+e+" :: "+o)}})}))}))}(jQuery);